Summer of Lust (2011)

Sylvia Delux,Barbie #FF0000,Bellina,Teena Dolly, Cathy Heaven

The temperature is not the only thing rising in this brand new film from Viv Thomas Production studios. The heat is making these couples ache and hunger for one thing only, hot sensuous sex!
As the aphrodisiac sun burns overhead the guys and girls groan with pleasure, shedding their clothes and consuming each other with greedy appetites. Welcome to the Summer of Lust

